features.script:
//两段位移动画+另外物位移
let originpos = feature.position.y

feature.on('click',e=>{
let r1 = feature.createAnimation('position')
  r1.setKeys([{
    frame: 15, 
    value: feature.position.add( new Vector3(0,-0.05,0) )}])
feature.startAnimations( [r1] )

setTimeout(()=>{
feature.position.y = originpos - 0.05
 let r2 = feature.createAnimation('position') 
 r2.setKeys([{ 
     frame: 15, 
     value: feature.position.add(new Vector3(0, 0.05, 0)) }]) 
 feature.startAnimations( [r2] )
feature.position.y=originpos
    }, 250);

